var container, stats;
var camera, scene, renderer;
var raycaster;
var mouse;
var prev = null;
var prevs = [];
var totalReviews = 0;

var PI2 = Math.PI * 2;
var programFill = function(context) {
    context.beginPath();
    context.arc(0, 0, 0.5, 0, PI2, true);
    context.fill();
};
var programStroke = function(context) {
    context.lineWidth = 0.025;
    context.beginPath();
    context.arc(0, 0, 0.5, 0, PI2, true);
    context.stroke();
};
var material = new THREE.LineBasicMaterial({
    color: 0xFFE500
});

container = document.querySelector(".node-box");
var info = document.querySelector('.info');

var INTERSECTED;
init();
animate();

function init() {



    camera = new THREE.PerspectiveCamera(30, window.innerWidth / window.innerHeight, 1, 10000);
    camera.position.set(0, 300, 500);
    scene = new THREE.Scene();
    var maxLat = 0,
        minLat = 1000,
        minLong = 1000,
        maxLong = 0,
        maxRate = 0,
        minRate = 100;
    var allLats = 0,
        allLongs = 0,
        allRates = 0;


    for (var busi of yelp) {
        if (busi.coordinate.latitude > maxLat)
            maxLat = busi.coordinate.latitude;
        if (busi.coordinate.latitude < minLat)
            minLat = busi.coordinate.latitude;
        if (busi.coordinate.longitude > maxLong)
            maxLong = busi.coordinate.longitude;
        if (busi.coordinate.longitude < minLong)
            minLong = busi.coordinate.longitude;
        if (busi.rating > maxRate)
            maxRate = busi.rating;
        if (busi.rating < minRate)
            minRate = busi.rating;

        allLongs += busi.coordinate.longitude;
        allLats += busi.coordinate.latitude;
        allRates += busi.rating;
    }

    var avgLats = allLats / yelp.length;
    var avgLongs = allLongs / yelp.length;
    var avgRate = allRates / yelp.length;

    for (var busi in yelp) {
        var particle = new THREE.Sprite(new THREE.SpriteCanvasMaterial({
            color: new THREE.Color("hsl(" + 175 + ", 80%, " + (yelp[busi].rating / maxRate * 100 - 15) + "%)"),
            program: programFill
        }));

        //particle.position.x = Math.random() * 800 - 400;
        particle.position.x = (yelp[busi].coordinate.latitude - avgLats) * 10 + 2 * (Math.random() * 80 - 40);
        particle.position.y = (yelp[busi].coordinate.longitude - avgLongs) * 10 + 2 * (Math.random() * 80 - 40);
        particle.position.z = (yelp[busi].rating - avgRate) * 100;
        particle.scale.x = particle.scale.y = Math.sqrt(yelp[busi].review_count/30)+0.2;
        particle.userData = yelp[busi];
        if (yelp[busi].review_count > 80)
            scene.add(particle);
    }

    //

    raycaster = new THREE.Raycaster();
    mouse = new THREE.Vector2();
    renderer = new THREE.CanvasRenderer();
    renderer.setClearColor(0x19232C);
    renderer.setPixelRatio(window.devicePixelRatio);
    renderer.setSize(window.innerWidth, window.innerHeight);
    container.appendChild(renderer.domElement);

    document.addEventListener('mousemove', onDocumentMouseMove, false);
    //
    window.addEventListener('resize', onWindowResize, false);
}

function onWindowResize() {
    camera.aspect = window.innerWidth / window.innerHeight;
    camera.updateProjectionMatrix();
    renderer.setSize(window.innerWidth, window.innerHeight);
}

function onDocumentMouseMove(event) {
    event.preventDefault();
    mouse.x = (event.clientX / window.innerWidth) * 2 - 1;
    mouse.y = -(event.clientY / window.innerHeight) * 2 + 1;
}
//
function animate() {
    requestAnimationFrame(animate);
    render();
}
var radius = 600;
var theta = 0;

function render() {
    // rotate camera
    theta += 0.1;
    camera.rotation.order = 'YXZ';
    camera.position.x = radius * Math.sin(THREE.Math.degToRad(theta*0.5));
    camera.position.y = radius * Math.sin(THREE.Math.degToRad(theta*0.2));
    camera.position.z = radius * Math.cos(THREE.Math.degToRad(theta*1));
    camera.lookAt(scene.position);
    camera.rotation.z = Math.PI/2;
    camera.updateMatrixWorld();
    // find intersections
    raycaster.setFromCamera(mouse, camera);
    var intersects = raycaster.intersectObjects(scene.children);
    if (intersects.length > 0) {
        if (INTERSECTED != intersects[0].object) {
            if (INTERSECTED) INTERSECTED.material.program = programFill;
            INTERSECTED = intersects[0].object;
            INTERSECTED.material.program = programStroke;

            if (INTERSECTED.type != "Line"){
                prevs.push(INTERSECTED);
                var active = INTERSECTED.userData;

                totalReviews += active.review_count;

                info.innerHTML = `<h3>${active.name}</h3>
                <p>Rating: ${active.rating} // Review Count: ${active.review_count}</p>
                <p>Selected: ${prevs.length-1} Businesses // Total Review Count: ${totalReviews}`;



                if (prev != null && prevs.length > 2) {
                    var geometry = new THREE.Geometry();
                    geometry.vertices.push(new THREE.Vector3(prev.position.x, prev.position.y, prev.position.z));
                    geometry.vertices.push(new THREE.Vector3(INTERSECTED.position.x, INTERSECTED.position.y, INTERSECTED.position.z));

                    var line = new THREE.Line(geometry, material)
                    scene.add(line);
                }

                prev = INTERSECTED;
            }
        }
    } else {
        if (INTERSECTED) INTERSECTED.material.program = programFill;
        INTERSECTED = null;
    }
    renderer.render(scene, camera);
}
